import Header from "./Header";
import RegionNav from "../../components/RegionNavigation"
import StoreItem from "../main/StoreItem";
import StoresOverview from "./StoresOverview";
import styled from "styled-components";
import AppRouter from "../../components/AppRouter";

const Home = () => {

    return (
        <div>
            <header style={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between', borderBottom: '1px solid #99D98C' }}>
                <img src={process.env.PUBLIC_URL + '/logo.png'} style={{ margin:'20px 20px', width: '200px', height: '100px' }} alt="logo"/>

                {/* 상단 네비게이션 */}
                <AppRouter /> 
            </header>
            <ContentContainer>
                <RegionNav />
                <StoresOverview type="카페"/>
            </ContentContainer>
        </div>
    );
}

const ContentContainer = styled.div`
    display: flex;
    flex-direction: row;
`;

export default Home;
